import React from 'react'
import { StyleSheet } from 'react-native'
import Center from './Center';

const StyleCentre = StyleSheet.create({
    
    conteiner:{
        display:'flex',
        alignItems:'center'
    },
    
    imgStyle :{
        margin:'5%',
        height:150,
        width:150,
        borderRadius:10000000
    },

    button:{
        margin:0,
        padding:0
    }
});

export default StyleCentre;
